import * as React from "react";
import {Container, Paper} from "@mui/material";
import Box from "@mui/material/Box";
import * as PropTypes from "prop-types";
import dayjs from 'dayjs';
import { DemoContainer, DemoItem } from '@mui/x-date-pickers/internals/demo';
import { AdapterDayjs } from '@mui/x-date-pickers/AdapterDayjs';
import { LocalizationProvider } from '@mui/x-date-pickers/LocalizationProvider';
import { DateCalendar } from '@mui/x-date-pickers/DateCalendar';

export default function TextAndDataInformation() {

    const paperStyle = {
        padding: "50px 20px",
        width: "95%",
        margin: "20px auto",
        borderRadius: 20,
        backgroundColor: "#e9dbd3"
    }


    return (
        <Container>
            <Paper elevation={3} style={paperStyle}>
                <Box>
                    <div className="textContent">
                        <h1>Дорогие гости!</h1>
                        <tr/>
                        <tr/>
                        <h3>
                            When you have some text, how can you choose a typeface? Many people—professional designers
                            included—go through an app’s font menu until we find one we like. But the aim of this Google
                            Fonts Knowledge module is to show that there are many considerations that can improve our
                            type choices. By setting some useful constraints to aid our type selection, we can also
                            develop a critical eye for analyzing type along the way.
                        </h3>
                        <div className="calendar">
                            <LocalizationProvider dateAdapter={AdapterDayjs}>
                                <DemoContainer components={['DateCalendar', 'DateCalendar']}>
                                    <DemoItem label="disabled">
                                        <DateCalendar defaultValue={dayjs('2022-04-17')} disabled />
                                    </DemoItem>
                                    <DemoItem label="readOnly">
                                        <DateCalendar defaultValue={dayjs('2022-04-17')} readOnly />
                                    </DemoItem>
                                </DemoContainer>
                            </LocalizationProvider>

                        </div>
                    </div>
                </Box>
            </Paper>
        </Container>
);
}
